import utra_logo from "./logos/UTRA_logo_square.png";
import toronto_skyline from "./Home Page Photos/torontoSkyline2.png";
import './Home.css';

function Home() {
  return (
    <div className = "bg text text-center pt-5">   
      <h1 className="pt-3 pb-5">Welcome to UTRAHacks!</h1>
      <img className = "pt-5" src= {toronto_skyline} alt = "Toronto Syline"/>
      <h2 className="pt-5">UTRAHacks 2023</h2>

    </div> 
  );
}

export default Home;
